const TestPage: FC = () => {
    const theme = useTheme()
    const { isStudante, isAuthenticated, user } = useAuth()

    const email = user?.email
    const navigate = useNavigate()
    const { id } = useParams()

    //const {selectionProcessTest} = useSelectionProcessesTestById(Number(id))

    const { deleteSelectionProcessTest } = useSelectionProcessTestMutations()
    const [wasSubmitted, setWasSubmitted] = useState(false);
    const [score, setScore] = useState<number | null>(null);

    const { register, handleSubmit, watch } = useForm<FormData>({
        defaultValues: {
            responses: fictitiousTest.questionList.map(() => -1),
        },
    });

    const onSubmit = (data: FormData) => {
        let correctCount = 0;
        data.responses.forEach((response, index) => {
            const correctIndex = fictitiousTest.questionList[index].questionAlternativeList.findIndex(
                (alt) => alt.isCorrect
            );
            if (response === correctIndex) {
                correctCount++;
            }
        });
        setScore(correctCount);
        setWasSubmitted(true);
    }

    const deleteModal = useModal()

    const handleOpenDeleteModal = () => deleteModal.current?.openModal()

    const handleCloseDeleteModal = () => deleteModal.current?.closeModal()

    const selectedResponses = watch("responses")

    const handleDelete = async () => {
        try{
            await deleteSelectionProcessTest.mutateAsync({id: Number(id), email: email || ''})
            navigate('/selection-process')
        }
        catch(err){
            handleCloseDeleteModal()
            console.log(err)
        }
    }

    if(deleteSelectionProcessTest.isPending) return <Loading/>

    return (
        <PageLayout title="Prova">
            <Box
                sx={{
                    maxHeight: "80vh",
                    "&::-webkit-scrollbar": {
                        width: theme.spacing(1),
                    },
                    "&::-webkit-scrollbar-track": {
                        backgroundColor: theme.palette.grey[300],
                        borderRadius: theme.spacing(0.5),
                    },
                    "&::-webkit-scrollbar-thumb": {
                        backgroundColor: theme.palette.grey[500],
                        borderRadius: theme.spacing(0.5),
                    },
                    "&::-webkit-scrollbar-thumb:hover": {
                        backgroundColor: theme.palette.grey[600],
                    },
                }}
            >
                <PagesDetailsHeader title={`Prova - ${fictitiousTest?.name}`}
                    rightSideComponents={isStudante || !isAuthenticated ? undefined : [
                        <Button key="editTest" variant="text" onClick={() => navigate(`/edit-test/${id}`)} startIcon={<Edit style={{ width: 16, height: 16 }} />}>
                            Editar Prova
                        </Button>,
                        <Button key="deletTest" sx={{ color: theme.palette.juicy.error.c50 }} variant="text" onClick={handleOpenDeleteModal} startIcon={<TrashCan style={{ width: 16, height: 16 }} />}>
                            Deletar Prova
                        </Button>
                    ]}
                />

                <Box sx={{ display: "flex", flexDirection: "row", justifyContent: "space-between" }} mb={2} mr={2}>
                    <Box sx={{ flexDirection: "column" }}>
                        <Typography >Data de aplicação</Typography>
                        <Typography fontWeight={FONT_WEIGHTS.light} sx={{ mb: 2 }}>
                            {fictitiousTest.applicationDate}
                        </Typography>


                    </Box>
                    <Box sx={{ flexDirection: "column" }}>
                        <Typography >Cargo</Typography>
                        <Typography fontWeight={FONT_WEIGHTS.light} >
                            {fictitiousTest.function.name}
                        </Typography>
                        <Typography sx={{ mb: 2 }} fontWeight={FONT_WEIGHTS.light} >
                            {fictitiousTest.function.description}
                        </Typography>
                    </Box>

                    <Box sx={{ flexDirection: "column" }}>
                        <Typography >Nível Institucional</Typography>
                        <Typography fontWeight={FONT_WEIGHTS.light} >
                            {fictitiousTest.professionalLevel.name}
                        </Typography>
                        <Typography sx={{ mb: 2 }} fontWeight={FONT_WEIGHTS.light} >
                            {fictitiousTest.professionalLevel.description}
                        </Typography>
                    </Box>
                </Box>

                {wasSubmitted && score !== null && (
                    <Chip
                        sx={{ mb: 2 }}
                        label={`You answered ${score} out of ${fictitiousTest.questionList.length} questions correctly.`}
                        color="primary"
                        variant="outlined"
                    />
                )}

                <form onSubmit={handleSubmit(onSubmit)}>
                    {fictitiousTest.questionList.map((question, i) => {
                        const userAnswer = selectedResponses[i];

                        return (
                            <Question
                                key={question.id}
                                question={question}
                                index={i}
                                register={register}
                                selectedAnswer={userAnswer}
                                wasSubmitted={wasSubmitted}
                            />
                        );
                    })}

                    <Box
                        sx={{
                            display: "flex",
                            gap: 2,
                            mt: 2,
                            justifyContent: "flex-end",
                        }}
                    >
                        <Button variant="outlined" type="button" onClick={() => console.log("Cancel")}>
                            Cancel
                        </Button>
                        <Button variant="contained" type="submit">
                            Submit
                        </Button>
                    </Box>
                </form>
            </Box>

            <Modal ref={deleteModal}>
                <ConfirmationModal text="Você tem certeza que deseja apagar a prova?" onCancel={handleCloseDeleteModal} onConfirm={handleDelete}/>
            </Modal>
        </PageLayout>
    )
}

export default TestPage